import "./App.css";
import "./index.css";

import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

import useScrollNavigation from "./useScrollNavigation";

import { AboutUs, HIW, Navbar, Pricing, FAQs } from "./components";
import { Header, Footer } from "./containers";

function App() {
  useScrollNavigation();

  return (
    <div className="App">
      <div className="wrap_main-content">
        <Navbar />
        <section id="header">
          <Header />
        </section>
        <section id="about-us">
          <AboutUs />
        </section>
        <section id="hiw">
          <HIW />
        </section>
        <section id="pricing">
          <Pricing />
        </section>
        <section id="faqs">
          <FAQs />
        </section>
      </div>
      <Footer />
    </div>
  );
}

export default App;
